import React, { useState } from 'react';



function App() {
  const [tasks, setTasks] = useState(['Aibek, Bagzhan, Albina, Danial, Erkebulan, Bobur, Nursultan B, Rasul, Aida)']);
  const [finishedTasks, setFinishedTasks] = useState([]);

  const handleTaskClick = (task) => {
    setTasks(tasks.filter((t) => t !== task));
    setFinishedTasks([...finishedTasks, task]);
  };

  const handleFinishedTaskClick = (task) => {
    setFinishedTasks(finishedTasks.filter((t) => t !== task));
    setTasks([...tasks, task]);
  };

  return (
    <div>
      <h2>Tasks:</h2>
      <ul>
        {tasks.map((task, index) => (
          <li key={index} onClick={() => handleTaskClick(task)}>{task}</li>
        ))}
      </ul>

      <h2>Finished Tasks:</h2>
      <ul>
        {finishedTasks.map((task, index) => (
          <li key={index} onClick={() => handleFinishedTaskClick(task)}>{task}</li>
        ))}
      </ul>
    </div>
  );
}

export default App;
